import './App.css';
import { BsPeopleFill, BsFillTelephoneFill, BsCircleHalf } from "react-icons/bs"
import React, { useEffect, useState } from 'react';


function App() {
  const [data, setData] = ({"response_code":0,"results":[{"category":"Entertainment: Cartoon & Animations","type":"multiple","difficulty":"easy","question":"In South Park, what is Stan&#039;s surname?","correct_answer":"Marsh","incorrect_answers":["Stotch","Broflovski","Tweak"]},{"category":"Entertainment: Video Games","type":"multiple","difficulty":"easy","question":"Pok&eacute;mon Go is a location-based augmented reality game developed and published by which company?","correct_answer":"Niantic","incorrect_answers":["Rovio","Zynga","Supercell"]},{"category":"Entertainment: Video Games","type":"multiple","difficulty":"easy","question":"In what year was Garry&#039;s Mod released as a standalone title on Valve&#039;s Steam distribution service?","correct_answer":"2006","incorrect_answers":["2007","2004","2003"]},{"category":"Entertainment: Video Games","type":"multiple","difficulty":"easy","question":"Which of the following is NOT a Nintendo game console?","correct_answer":"Dreamcast","incorrect_answers":["SNES","Wii","Switch"]}]})
  const [questionNumber, setquestionNumber] = useState(data ? 0 : null)
  const url = "https://opentdb.com/api.php?amount=4&difficulty=easy&type=multiple"

  const [answers, setAnswers] = useState([0, 0, 0, 0]);

  useEffect(() => {
    if (data === null) {
      // Data is null, fetch it
      fetch(url)
        .then((res) => {
          if (!res.ok) {
            throw new Error(`HTTP error! Status: ${res.status}`);
          }
          return res.json();
        })
        .then((d) => {
          setData(d);
        })
        .catch((error) => {
          console.error('Fetch error:', error);
        });
    }
  }, []);

  const randomAnswer = () => {
    let answerIndex = Math.floor(Math.random() * 4)
    let tempAnswers = [0, 0, 0, 0]
    for (let i = 0; i < 4; i++) {
      if (i == answerIndex) {
        tempAnswers[i] = "data"
      } else {
        tempAnswers[i] = ""
      }
      ;

    }
  }

  const levels = [["1,000,000", "12"], ["500,000", "11"], ["200,000", "10"], ["100,000", "9"], ["50,000", "8"], ["25,000", "7"], ["15,000", "6"], ["10,000", "5"], ["7,000", "4"], ["5,000", "3"], ["2,000", "2"], ["1,000", "1"]]
  const fetchInfo = async () => {
    return await fetch(url)
      .then((res) => res.json())
      .then((d) => { setData(d); })
  }


  const onAnswer = (e) => {
    console.log(Math.floor(Math.random() * 4))
  }
  return (
    <>
      <div class="wrapper">
        <svg>
          <text x="50%" y="50%" dy=".35em" text-anchor="middle">
            QUIZ TIME!
          </text>
        </svg>
      </div>
      <div class="flex md:px-20 gap-5 sm:px-0 ">
        {/* JOKERS AND LEVELS */}
        <div class="w-1/4 p-4 border-r">
          <div class="mb-4">
            <div class="flex  justify-around flex-row mb-2">
              <button class="flex justify-center items-center w-20 h-20 rounded-full bg-gray-800 hover:shadow-lg transition focus:outline-none">
                <BsPeopleFill color='white' size={32} />
              </button>
              <button class="flex justify-center items-center w-20 h-20 rounded-full bg-gray-800 hover:shadow-lg transition focus:outline-none">
                <BsFillTelephoneFill color='white' size={32} />
              </button>
              <button class="flex justify-center items-center w-20 h-20 rounded-full bg-gray-800 hover:shadow-lg transition focus:outline-none">
                <BsCircleHalf color="white" size={32} />
              </button>
            </div>
            <ul>
              {levels.map((e, i) => {
                return <li key={i} class="flex justify-between items-center mb-2">
                  <span className={(e[1] === "1" || e[1] === "7" || e[1] === "12" ? 'text-orange-500' : "")}>Level {e[1]}</span>
                  <span className={(e[1] === "1" || e[1] === "7" || e[1] === "12" ? 'text-orange-500' : "")}>${e[0]}</span>
                </li>
              })}

            </ul>
          </div>
        </div>
        {/* QUESTION LAYOUT */}
        <div class="w-3/4 p-4">
          <div class="mt-8">
            <div class="mb-6">
              <h3 class="text-xl font-semibold">Question:</h3>
              <p>
                {data.results[questionNumber].question}
              </p>
              <div class="flex space-x-2">
                <span class="bg-gray-600 text-white py-2 px-3 rounded-full text-sm m-2">{data.results[questionNumber].difficulty.toUpperCase()}</span>
                <span class="bg-gray-600 text-white py-2 px-3 rounded-full text-sm m-2">{data.results[questionNumber].category.toUpperCase()}</span>
              </div>
            </div>

            <div class="grid grid-cols-2 gap-9">
              {[...Array(4)].map((e, i) => (

                <button key={i} onClick={e => onAnswer()} class="bg-white border-black    text-black font-semibold py-2  rounded-lg transition transform hover:scale-105">
                  {/*                   <div className='w-full h-full'>{i == answerIndex ? data.results[questionNumber].correct_answer : data.results[questionNumber].incorrect_answers[i]} </div>
 */}                </button>
              ))}
            </div>
          </div>

        </div>
      </div>
    </>

  );
}

export default App;
